import { Link } from "react-router-dom";
import "../css/navigation.css";
import logo from "../logos/bransome3.png";
const Navigation = () => {
  return (
    <nav id="navbar_box">
      <header className="navbar_logo">
        <Link to="/">
          <img src={logo} />
        </Link>
      </header>
      <ul className="navbar_links">
        <li className="navbar_item">
          <Link to="/" className="navbar_home_btn">
            Home
          </Link>
        </li>
        <li className="navbar_item">
          <Link to="/brand" className="navbar_brand_btn">
            Brands
          </Link>
        </li>
        <li className="navbar_item">
          <Link to="/best20" className="navbar_best_btn">
            Best20
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
